import React from 'react'
import FeedItem from './feedItem'

let style = {
    overflow: 'scroll',
    height: '350px'
}

let unregistered = ''

setTimeout(() => {
    unregistered += '<FeedItem></FeedItem>'
    console.log(unregistered)
}, 3000)

const unregisteredFeed = (feedArray) => {
    return(
    <div style={style}>
        <h1>Unregistered Activity</h1>
        {[<FeedItem key="1">abcdfe</FeedItem>]}
    </div>)
}

export default unregisteredFeed
